const ItemList = ({products }) => { 

  
    return (

        <>
               {products.map((product, i)=>{
            return <Item key={product.id} name={product.title} price={product.price}  id={product.id} image={product.image}/>

        })

        }
        

        
</>

)}

export default ItemList
